		<Modal show={props.form ? true : false} animation={false} onHide={props.setForm}>
	      <Modal.Header closeButton>
	        <Modal.Title className="text-primary">
	          <b>Editar Usuario</b>
	        </Modal.Title>
	      </Modal.Header>
	      <Modal.Body>
	      	asd
	      </Modal.Body>
	    </Modal>
	);
}

export default SaveExpedient;
